import React from 'react'



export default function InsideModifier({title,list}) {


  const PresetList=['Random','Coin','Sound3','Sound4','Sound5','Sound6']
  
  let soundButton;
  if(title === 'Presets'){
    soundButton = PresetList.map((preset,index)=>(
      <button key={index} style={{width:81,margin:3}}><b>{preset}</b></button>
    ));
  }

  let listitem;
  listitem = list.map((item,index)=>(
    <tr><td key={index}>{item}</td>
    <td style={{textAlign:'right'}}><input type='range' min={0} max={1} step={0.01} style={{width:170}}></input></td></tr>
  ))

  return (
    <div className='insideModifier'>
      <div style={{paddingLeft:6,paddingRight:6}}>{title}</div>
      <div>
        <table id='tablewidth'>
          {listitem}
        </table>
      </div>
      <div className='rangeInput'>
        {soundButton}
      </div>
    </div>
  )
}
